import React, { Component } from 'react';
import '../website.css';


class Home extends Component {
    render() {
        console.log('rendering home');


        return (
            <div className="Home">
                <div className="outer-page">
                    <p>HI! I'm</p>
                    <div className="name">
                        <p>WARREN WANG</p>
                    </div>

                </div>
            </div>
        );
    }
}

export default Home;
